import React, { FC, useState, useEffect } from 'react';
import './App.css';
import axios from "axios";
import CardCar from './components/CardCar/CardCar';
import Search from './components/searchnum/searchnum'
import Spinner from 'react-bootstrap/Spinner';

interface Car {
  comments: string[];
  digits: string;
  is_stolen: boolean;
  model: string;
  model_year: number;
  operations: Array<any>;
  photo_url: string;
  region: {
    name: string;
    name_ua: string;
    slug: string;
    old_code: string;
    new_code: string;
  };
  stolen_details: any;
  vendor: string;
  vin: string;
}




function App() {

  const [carData, setCarData] = useState<Car | null | string>(null);

  return (
    <div className="App">
          <div className="background"></div>
          <Search setDataFromSearch = {setCarData}></Search>
          {typeof carData === 'object' && carData !== null && 'vin' in carData && (
            <CardCar
              num="Нет"
              vin={(carData.vin || '').toString()}
              img={carData.photo_url || ''}
              wanted={Boolean(carData.is_stolen)}
              brand={carData.vendor || ''}
              model={carData.model || ''}
              modelyear={(carData.model_year || '').toString()}
              region={(carData.region && carData.region.name) || ''}
            />
        )}
    </div>
  );
}

export default App;
